INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (165,'009','한밭중에 호랑이를 만났으니 나아감이 물러감이 어렵겠습니다. 일을 하고자 해도 문제이 많으니 한달 심명만 흘비하겠습니다. 새로운 일을 찾아 나선다거나 무리함은 다 불리합니다. 사람마다 나를 돕지 않고 요히려 해하려고 하니 마음이 불안하고 불편합니다. 처음은 비록 고단하고 어렵지만 나게라도 좋은 운이 기다리고 있으니 염려할 것은 없습니다. 미겁되는 일이 있거든 가히 악사람에게 의논해 보십시오. 풀릴 것입니다. 하반기에는 길사운이 문에 바치니 기쁜 일이 출중 하겠습니다. 봄철에 길함이 있으니 그때 기회를 놓여서는 안됩니다.','욕심이려다가 다시 얼차게 됩니다. 이를 버리고 싹어도 뜻대로 대지 어렵습니다. 그러나 길손이 문에 비치니 기쁜 일이 생길 것입니다. 봄철에 길함이 있으니 이 기회를 놓이면 절대로 안됩니다. 어렵더라도 굳세게 도전하십시오.','봄동산에 마침내 봄이 돌아와 꽃이 만발하고 역매를 묻었으니 이보다 더 좋은 일이 있겠습니까? 꽃이 곳곳마다 있으니 가는 곳마다 봄바람이 불어 휘휘하겠습니다. 만약 관흉이 아니라면 잠병이 생겨서 몸을 피곤하게 할지도 모릅니다.','다른 사람에게 갈 재물이 의외로 넘게 돌아와 주니 이 무슨 후회입니까? 동남방의 재물이 뜻밖에 문안으로 들어오니 일을 벌이고 성사시킬 데서 비록된 것이며 반드시 은밀히 처리 화 일이 생길 것이니 이익이 그 가운데 있습니다.','둥 사람은 함부러 가까이 해서는 안됩니다. 또한 잠병이 침혹할 것이니 몸을 조심하십시오. 기쁜 중에도 조심이 있으니 관흉을 조심해야합니다. 분수를 지키고 편안하게 거한다면 흉을 면하고 뜻밖의 성공을 거둘 수있습니다.','은밀히 진행시킬 일이 마침내 성공하여 즐성하게 될 것이니 친척이 아니면 외척간에 도모한 일일 것입니다. 길함이 몸에 임했으니 반드시 기쁜 일이 생깁니다. 그러나 마음 한구석에 조심이 있으니 어찌하겠습니까? 안정하면 문제는 없겠습니다.','달이 구름에 드니 좋은 달빛을 다시 보기 어렵습니다. 남방은 불행하니 출행하지 마십시오. 너무 밝어붙이지 말고 여유를 가져야 합니다. 바라는 일은 왕성 추진해도 형사가 되고 많이 험만 쓸 필요가 없습니다. 마음 한구석에 조심이 있으니 어찌하겠습니까? 안정하면 문제는 없겠습니다.','신수가 대길하니 흉험 중에서도 길함이 있습니다. 통하는 길이 남북으로 나있으니 분주하여 여가가 없습니다. 버린 일을 성취하고 마무르지으려하는데 어찌 바쁘지 않겠습니까? 명호가 수풀에서 나오니 그 형세가 당당하여 초목이 떨어 격입니다.','화가 급려서 돌이 되니 마음의 근심이 없습니다. 음양이 서로 화합하였는데 어찌 길함이 없겠습니까? 만약 관례이 아니라면 불시에 자손의 경사입니다. 하고져 하는 일이 막혔다가도 도리어 이익이 되게 풀리주는데 무엇을 주저하겠습니까? 진행함이 좋습니다.','두 호랑이가 서로 싸움을 바였으니 어느 호랑이가 이기고 어느 호랑이가 지겠습니까? 만약 시비를 벌이면 이와 같아서 요히려 구설수만 늘게 되겠습니다. 만약 그렇지 않으면 관재를 만나 도리어 화를 입게될 것이니 시비를 가까이 하지 마십시오.','출행하면 불리하니 욋것을 지키고 안정하십시오 새것을 도모하려다 가는 욋것을 앗게 될지도 모릅니다. 그러나 만약 집에 우환이 있을 같으면 미리 불공을 들이십시오. 그러면 그 흉을 면하게 될 것입니다. 마침내 욋것을 버리고 새것을 찾으니 사람들이 우러러며 따르게 될 것입니다.','사람을 잘못 사귐으로 해서 해가 있으니 부당한 이익을 취하려고 하지 마십시오 신수가 불길하니 잠병을 조심하고 건강에 유의해야 합니다. 이 달의 여수는 흉함이 많고 길함이 적습니다. 너무 취하려 한다면 도리어 내 것까지 앗을까 두렵습니다.','몸이 편안하고 근심이 없으니 몸과 집안이 태평하겠습니다. 구름이 흩어지고 달이 나오니 마침내 소망을 이루게됩니다. 비록 직업을 고치긴 하나 험되이 마